import React from 'react'
import {Button} from "@chakra-ui/react"
import { Tracker } from '../components/Tracker'

export const Dashboard = () => {
  return (
    <div>
        <Button>Tracker</Button>
        <Button>Analytics</Button>
        <Button>History</Button>

        <Tracker/>
    </div>
  )
}
